import React from 'react'
import './Header.css';

function Header() {
  return (
    <div className="header">
        <Link to="/">
            <h1>Portfolio</h1>
        </Link>
        <ul>
            <li><Link to="/">Home</Link></li>
        </ul>
    </div>
  )
}

export default Header;
